svg.script:

	  var diagramGroup = Snap.select('#Layer_1');
  	  var messagePC = diagramGroup.select("#messagePC").attr('opacity', 0);
	  var messageMobile = diagramGroup.select("#messageMobile").attr('opacity', 0);
	  var audioPC = diagramGroup.select('#audioPC').attr('opacity', 0);
	  var audioMobile = diagramGroup.select('#audioMobile').attr('opacity', 0);
	  var imagePC = diagramGroup.select('#imagePC').attr('opacity', 0);
	  var loginIndicatorPC = diagramGroup.select('#loginIndicatorPC').attr('fill', '#E6E7E8');
	  var loginIndicatorMobile = diagramGroup.select('#loginIndicatorMobile').attr('fill', '#E6E7E8');
	  var imageMobile = diagramGroup.select('#imageMobile').attr('opacity', 0);
      var executeSVG = function(){
         done=true;
         setTimeout(function(){
          loginIndicatorPC.animate({fill: '#ee6a5a'}, 100, mina.easein);
          messagePC.attr('transform', 'translate(0,323.909)');
          messagePC.animate({opacity: 1}, 0);
          var messageLines = [];
          for(var i=1;i<=4;i++)
            messageLines[i-1] = diagramGroup.select('#line'+(i)).attr('width', 0);
          messageLines[0].animate({width: 94.441}, 300, function(){
            messageLines[1].animate({width: 286.78}, 300, function(){
              messageLines[2].animate({width: 286.78}, 300, function(){
                messageLines[3].animate({width: 114.02}, 300, mina.elastic, function(){
                  loginIndicatorMobile.animate({fill: "#ee6a5a"}, 100, mina.easein);
                  messageMobile.attr('transform', 'translate(11, 62.581)')
                  messageMobile.animate({opacity: 1}, 100, mina.easein);
                  setTimeout(function(){
                    messageMobile.animate({transform: 'translate(11,-14)'},200, function(){
                      audioMobile.attr('opacity', 1);
                      diagramGroup.select('#audioUpload').attr('width', 178.88).animate({x: 1351.68, width: 0}, 1000, function(){
                        messagePC.animate({transform: 'translate(0, 201.915)'}, 200, function(){
                          audioPC.attr('transform', 'translate(0, 199.99)');
                          var audioDownload = diagramGroup.select('#audioDownload').attr('width', 285);
                          audioPC.animate({opacity: 1}, 100, mina.easein, function(){
                            audioDownload.animate({width: 0, x: 705}, 1000, function(){
                              messagePC.animate({transform: 'translate(0,0)'}, 500);
                              audioPC.animate({transform: 'translate(0,0)'}, 500, function(){
                                imagePC.attr('opacity', 1);
                                audioMobile.animate({transform: 'translate(11, -145)'}, 200);
                                messageMobile.animate({transform: 'translate(11,-145)'}, 200, function(){
                                  imageMobile.animate({opacity: 1}, 200, mina.easein);
                                });
                              });
                            });
                          });
                        });                        
                      });

                    });
                  }, 500);
                });
              });
            });

          });
         }, 1000);
      }

done = false;
document.execute = function(){
  if(!done)
    executeSVG();
}
